	move $t2, $zero
	la $t0, 0($s0)			# set $t0 to the BASE_ADDRESS
	la $t1, level_2			# set $t1 to level_2
	start_level_2_loop:
	bge $t0, $s1, end_start_level_2
	lw $t2, 0($t1)
	sw $t2, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	j start_level_2_loop
	end_start_level_2: 
	jal character
	j input_checker

level_3_set:
	li $s0, BASE_ADDRESS 
	li $s1, MAX_ADDRESS
	move $s4, $zero 		# $s4 is the Number of coins
	move $t2, $zero
	la $t0, 0($s0)			# set $t0 to the BASE_ADDRESS
	la $t1, level_3		# set $t1 to level_3
	start_level_3_loop:
	bge $t0, $s1, end_start_level_3
	lw $t2, 0($t1)
	sw $t2, 0($t0)
	addi $t0, $t0, 4
	addi $t1, $t1, 4
	j start_level_3_loop
	end_start_level_3: 
	jal character
	j input_checker

input_checker:
	li $s7, 0xffff0000
    	lw $s6, 0($s7)
    	beq $s6, 1, input_detected      # if any input, go to the input function
    	j input_checker             	# else go keep checking for any input

input_detected:
	lw $t9, 4($s7)
    	beq $t9, 0x61, move_left		# if input is 'a', move left
    	beq $t9, 0x77, move_up			# if input is 'w', move up
    	beq $t9, 0x73, move_down		# if input is 's', move down
    	beq $t9, 0x64, move_right		# if input is 'd', move right
    	beq $t9, 0x70, reset			# if input is 'p', restart the game
    	beq $t9, 0x31, can_clone		# if input is '1', check if the person can clone; if so, create the clone
    	beq $t9, 0x32, can_control_clone	# if input is '2', the user is controlling the clone
    	beq $t9, 0x33, can_control_main		# if input is '3', the user is controlling the main player

	j input_checker

can_clone:
	lw $t8, game_data+4
	beq $t8, 1, clone_character_builder
	j input_checker

can_control_clone:
	#lw $t8, game_data+4
	#bne $t8, 1, input_checker
	lw $t8, game_data+12
	bne $t8, 1, input_checker
	j control_clone
	
can_control_main:
	lw $t8, game_data+16
	bne $t8, 1, input_checker
	j control_main

control_clone:
	li $t8, 1
	sw $t8, game_data+8
	j input_checker

control_main:
	li $t8, 0
	sw $t8, game_data+8
	j input_checker
	
move_right:
	lw $t8, game_data+8
	beq $t8, 0, right_motion
	beq $t8, 1, right_motion_clone
	
move_left:
	lw $t8, game_data+8
	beq $t8, 0, left_motion
	beq $t8, 1, left_motion_clone
	
move_up:
	lw $t8, game_data+8
	beq $t8, 0, climb_up
	beq $t8, 1, climb_up_clone

move_down:
	lw $t8, game_data+8
	beq $t8, 0, climb_down
	beq $t8, 1, climb_down_clone

